import React from 'react';
import { NavLink } from 'react-router-dom';
import './Navigation.css';

function Navigation() {
  return (
    <nav className="navigation">
      <div className="nav-brand">
        <h1>ClientEcho</h1>
      </div>
      <ul className="nav-links">
        <li>
          <NavLink to="/" end>
            Dashboard
          </NavLink>
        </li>
        <li>
          <NavLink to="/feedback">
            Feedback
          </NavLink>
        </li>
      </ul>
    </nav>
  );
}

export default Navigation;
